r:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"30601","type":"CustomJS"},{"attributes":{"format":"0 a"},"id":"30507","type":"NumeralTickFormatter"},{"attributes":{},"id":"30755","type":"StringEditor"},{"attributes":{"data":{},"selected":{"id":"30336"},"selection_policy":{"id":"30335"}},"id":"30318","type":"ColumnDataSource"},{"attributes":{"label":{"value":"SMA(C[4H],25)"},"renderers":[{"id":"30582"}]},"id":"30598","type":"LegendItem"},{"attributes":{"format":"0,0.[00]%"},"id":"30316","type":"NumeralTickFormatter"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"returns_positive","transform":{"id":"30264"}},"hatch_alpha":{"value":0.1},"line_alpha":{"value":0.1},"marker":{"value":"inverted_triangle"},"size":{"field":"marker_size"},"x":{"field":"index"},"y":{"field":"returns_short"}},"id":"30456","type":"Scatter"},{"attributes":{},"id":"30758","type":"StringFormatter"},{"attributes":{"line_alpha":0.2,"line_color":"#ff7f0e","line_width":1.3,"x":{"field":"index"},"y":{"field":"SMA(C[4H],25)_1_1"}},"id":"30581","type":"Line"},{"attributes":{},"id":"30468","type":"DataRange1d"},{"attributes":{"source":{"id":"30261"}},"id":"30
